"231331":{"id":"231331","name":"Primeiro as Damas: Mulheres no Hip-Hop","slug":"primeiro-as-damas-mulheres-no-hip-hop","original_title":"Ladies First: A Story of Women in Hip-Hop","overview":"Nesta série documental, rappers, compositoras e especialistas falam sobre a influência das mulheres na música e na cultura do hip-hop.","first_air_date":"2023-08-09","episode_run_time":42,"vote_average":7.5,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":[],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/upVTBapP5ALF6k2s9CiMoD9a4YJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/4vtWCNunNhurrFCp1s4nqTlp8cF.jpg","cast":["Queen Latifah","Rah Digga","Latto","MC Lyte","Saweetie"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2023-08-09","episode_count":4,"overview":"N/A","vote_average":7.4,"episodes":{"1":{"name":"Moldando o hip-hop","overview":"Nos primórdios do hip-hop, Sha-Rock, Roxanne Shanté e MC Lyte usam rimas com perspectivas únicas e mensagens ousadas para reivindicar o espaço das mulheres na cena.","air_date":"2023-08-09","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/dSZtuRvKrlKoJTQVSrNXDYiBcWT.jpg","vote_average":5.5},"2":{"name":"O que elas enfrentam?","overview":"Em uma indústria dominada por homens, mulheres enfrentam críticas, colorismo e outros obstáculos quando tentam expressar as próprias ideias e definir suas narrativas.","air_date":"2023-08-09","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/h4VwcCoLotxP0WYLXwWokwEpKyE.jpg","vote_average":8},"3":{"name":"O que elas perderam?","overview":"Artistas, produtoras e escritoras contam suas histórias de abuso e apagamento no mundo do hip-hop em meio a conflitos contratuais, violência e muito mais.","air_date":"2023-08-09","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/fhkhBz43asRYCDuOaEowSU6Xe26.jpg","vote_average":8},"4":{"name":"O que está mudando?","overview":"As mulheres refletem sobre suas jornadas ao longo de décadas no hip-hop, falam sobre a sororidade no rap e reforçam que são mais fortes juntas do que separadas.","air_date":"2023-08-09","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/5lJs5HlNwMt4zZxKvziG75QpO1Q.jpg","vote_average":8}}}}},
