"85922":{"id":"85922","name":"Space Force","slug":"space-force","original_title":"Space Force","overview":"Muito a contragosto, um general de quatro estrelas se une a um excêntrico cientista com a missão de fazer decolar a mais nova agência militar dos EUA, a Força Espacial.","first_air_date":"2020-05-29","episode_run_time":30,"vote_average":6.5,"number_of_seasons":2,"number_of_episodes":17,"created_by":["Steve Carell","Greg Daniels"],"production_companies":["3 Arts Entertainment","Deedle-Dee Productions","Film Flam"],"genres":["Comédia","Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/lV6WA95QboTUQDkFWjP3wI9U8xp.jpg","poster_path":"https://image.tmdb.org/t/p/original/zgu3p4NvisS8CI68cUfBKbvAvu8.jpg","cast":["Steve Carell","John Malkovich","Ben Schwartz","Diana Silvers","Tawny Newsome"],"trailer":"cUbD_2SC14c","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9jISgVIIRsgJLZxLAFMcTn8H2kl.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9jISgVIIRsgJLZxLAFMcTn8H2kl.jpg","air_date":"2020-05-29","episode_count":10,"overview":"Muito a contragosto, um general de quatro estrelas se une a um excêntrico cientista com a missão de fazer decolar a mais nova agência militar dos EUA, a Força Espacial.","vote_average":6.9,"episodes":{"1":{"name":"O lançamento","overview":"O general Mark Naird, líder da recém-criada Força Espacial, é pressionado a lançar um satélite, apesar da advertência dos cientistas","air_date":"2020-05-29","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/t3uAHs5VIimhOQ8VPEyka9or20w.jpg","vote_average":6.9},"2":{"name":"Salvando o Epsilon 6!","overview":"Com o satélite danificado, o general Naird precisa decidir entre uma solução científica bem fundamentada e uma missão de resgate liderada por um chimpanzé.","air_date":"2020-05-29","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/bopQn4e1VpeLZIte8HzvoH9vyzh.jpg","vote_average":7.1},"3":{"name":"Mark e Mallory vão a Washington","overview":"O general Naird e o Dr. Mallory se preparam para uma audiência complicada no Capitólio. Erin passeia com a capitã Ali.","air_date":"2020-05-29","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/56v2xLKe2mAtu0EJ6uftQsJD4aB.jpg","vote_average":6.8},"4":{"name":"Habitat lunar","overview":"O general Naird se oferece para participar do experimento lunar do Dr. Mallory. Erin tenta dar uma festa. A Força Espacial ganha novos uniformes.","air_date":"2020-05-29","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/tuvt9HsewYpi3JN5YlpTaCChUQt.jpg","vote_average":6.7},"5":{"name":"Jogo de guerra","overview":"A Força Espacial participa dos jogos de guerra contra sua maior rival, a Força Aérea. O problema é que as armas dos soldados do general Naird não são nada intimidadoras.","air_date":"2020-05-29","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/uy6sZTyYQuCFgFVxhB29HdEzQxw.jpg","vote_average":6.3},"6":{"name":"O espião","overview":"Animado com a vitória nos jogos de guerra, o general Naird toma um choque de realidade ao descobrir que pode haver um espião na Força Espacial.","air_date":"2020-05-29","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/tjMFWMQEbaSdYy5Fvkwcu11mH3O.jpg","vote_average":7},"7":{"name":"Edison Jaymes","overview":"Uma famosa empreendedora oferece seu revolucionário combustível de foguete à Força Espacial. Dr. Chan dá um curso intensivo de botânica para a capitã Ali.","air_date":"2020-05-29","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/17oGzYrSLFuX6qNkUZCFaDKKhNy.jpg","vote_average":6.9},"8":{"name":"Visita íntima","overview":"É dia de visita conjugal, e o foguete do general Naird está pronto para decolar. O Dr. Chan dá carona para a capitã Ali. O prazo do Dr. Mallory está quase no fim.","air_date":"2020-05-29","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/820uOExhvmRqod1P7XNou9r9EUA.jpg","vote_average":6.7},"9":{"name":"De volta à Lua","overview":"Faltando poucos dias para o lançamento, o general Naird tem de lidar com uma tripulação despreparada. A capitã Ali tenta encontrar as palavras certas. Erin visita a mãe.","air_date":"2020-05-29","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/lUdQnRynmVykWqRV5E90zXBL48c.jpg","vote_average":7.3},"10":{"name":"Reação proporcional","overview":"Sob pressão para retaliar a China, o general Naird tem uma crise de consciência. Dr. Mallory faz uma ameaça. Erin se rebela.","air_date":"2020-05-29","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/5z8Wr8BmJ40i31XsqQQwKRfq9m8.jpg","vote_average":7.1}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/msSPkdOhZlqreqYxHW2Ynap67sK.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/msSPkdOhZlqreqYxHW2Ynap67sK.jpg","air_date":"2022-02-18","episode_count":7,"overview":"Sob novo comando, o General Naird e sua tripulação disfuncional e cativante têm quatro meses para provar que vale a pena manter a Força Espacial ativa.","vote_average":6.2,"episodes":{"1":{"name":"O julgamento","overview":"O novo secretário de defesa julga o General Naird no Pentágono. A equipe precisa depor para salvar o emprego dele.","air_date":"2022-02-18","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/jvg5UInCzOWT0zKrIBh1TRy3PoQ.jpg","vote_average":5.917},"2":{"name":"Cortes no orçamento","overview":"A Força Espacial enfrenta cortes drásticos no orçamento, para desespero do General Naird e do Dr. Mallory. Dr. Chan tenta descobrir por que o Capitão Ali anda distante.","air_date":"2022-02-18","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/zpxxwTSHVHsPPcl0cuMNtZgYqf0.jpg","vote_average":5.6},"3":{"name":"A delegação chinesa","overview":"A equipe faz o possível para não ofender uma delegação da China, mas é difícil para o Dr. Mallory encarar um negacionista do pouso na Lua e ficar quieto.","air_date":"2022-02-18","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/zjh27TW9UJCwBhuyRFgNXAJ5J54.jpg","vote_average":6.7},"4":{"name":"Projeto Europa","overview":"A Força Espacial precisa tomar uma decisão: será que eles devem fazer uma apresentação sobre uma invasão alienígena ou uma guerra de brincadeiras da equipe?","air_date":"2022-02-18","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/fKgvmtOne3I9Rzts4JLWc0Gopp0.jpg","vote_average":6.1},"5":{"name":"Confiança turbinada","overview":"Erin recebe conselhos conflitantes sobre uma entrevista para a faculdade. Tony estabelece uma nova parceria entre a Força Espacial e um energético chamado Bufando.","air_date":"2022-02-18","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/xas3TDCgK8tVsJWH6olRRG1G5DB.jpg","vote_average":6.2},"6":{"name":"A consulta médica","overview":"Tony espalha um boato de que o General Naird estaria procurando outro emprego. Dr. Chan e Dr. Mallory buscam mesmo uma nova oportunidade profissional.","air_date":"2022-02-18","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/AoC7uzWXPYZmz4TY1Y1uLiS3jjQ.jpg","vote_average":6.1},"7":{"name":"Hackers","overview":"Com o futuro da Força Espacial incerto, grandes mudanças podem acontecer. Mas, antes, a base é hackeada e a equipe precisa resolver o problema.","air_date":"2022-02-18","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/xw1Jfc0Dxz2aSdMWqWfZs8Lnyh1.jpg","vote_average":6.7}}}}},
