"123992":{"id":"123992","name":"Anjos da Guarda","slug":"anjos-da-guarda","original_title":"Anjos da Guarda","overview":"Acompanhe o trabalho dos bombeiros de Santa Catarina, os verdadeiros \"anjos da guarda\" em salvamentos, combates a incêndios e resgates.","first_air_date":"2015-08-04","episode_run_time":45,"vote_average":9.3,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Carla Albuquerque","Beto Ribeiro"],"production_companies":["Medialand"],"genres":["Action & Adventure","Reality"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","poster_path":"https://image.tmdb.org/t/p/original/9u6n0t4xb6ubsdVtAfDCg78ZU8U.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9u6n0t4xb6ubsdVtAfDCg78ZU8U.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9u6n0t4xb6ubsdVtAfDCg78ZU8U.jpg","air_date":"2015-08-04","episode_count":16,"overview":"Acompanhe o trabalho dos bombeiros de Santa Catarina, os verdadeiros \"anjos da guarda\" em salvamentos, combates a incêndios e resgates.","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"Dois casos colocam os anjos da guarda em alerta: uma senhora é vítima de trânsito e uma casa pega fogo.","air_date":"2015-08-04","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Os bombeiros precisam agir rapidamente para conter um ataque de abelhas numa casa no meio da Florianópolis-SC e também socorrer as vítimas de um grave acidente de carro na madrugada.","air_date":"2015-08-11","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Mais um dia com vários atendimentos, os anjos da guarda chegam a tempo para salvar um homem que coloca a vida em risco ao beber demais, resgatam uma criança em apuros e um acidente doméstico deixa uma pessoa ferida ao cair do armário.","air_date":"2015-08-18","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"De um problema numa creche infantil à chamada de um acidente numa das pontes de Florianópolis, os bombeiros de Santa Catarina correm contra o tempo e contra o destino em mais um dia de trabalho.","air_date":"2015-08-25","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"O grupo de bombeiros nos levam até um grave acidente entre um carro e uma moto e também para dentro da casa de um idoso que precisa de socorro imediato.","air_date":"2015-09-01","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Confira os bombeiros de Santa Catarina em ações rápidas de salvamento desde um acidente de carro até um vazamento de gás numa rua populosa da cidade de Florianópolis.","air_date":"2015-09-08","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Os chamados do dia pedem urgência: um homem se fere na cabeça e um acidente de moto coloca outras pessoas em risco.","air_date":"2015-09-15","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Um homem com sobrepeso precisa de ajuda para ir ao hospital, um foco de incêndio num matagal precisa ser contido e uma briga com arma branca faz uma vítima precisar de socorro imediato.","air_date":"2015-09-22","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"Os bombeiros de Santa Catarina saem para mais ações de urgência: um homem cai de cabeça no chão e pessoas estão presas nas ferragens de uma acidente de carro.","air_date":"2015-09-29","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"O jogo de futebol entre amigos termina com um dos jogadores feridos, uma pessoa tem um mal súbito em casa, e um outro chamado chega aos bombeiros: existe uma vítima precisando de socorro num cemitério.","air_date":"2015-10-06","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"Os anjos da guarda precisam correr para várias regiões de Florianópolis-SC ao mesmo tempo: uma mulher grávida precisa de ajuda, um idoso de socorro e um motociclista fica em desespero após um acidente de trânsito.","air_date":"2015-10-13","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"Os bombeiros mostram mais do seu trabalho num dia em que precisam conter um incêndio provocado no meio de uma viela e ajudar um senhor vítima de briga de rua.","air_date":"2015-10-20","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"13":{"name":"Episódio 13","overview":"Os anjos da guarda de Santa Catarina chegam para ajudar pessoas presas num elevador e para os primeiros socorros a um homem não consegue andar.","air_date":"2015-10-27","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"14":{"name":"Episódio 14","overview":"Os bombeiros seguem para novos chamados: um homem embriagado termina atropelado e um outro acidente de carro faz mais vítimas na noite de Florianópolis-SC.","air_date":"2015-11-03","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"15":{"name":"Episódio 15","overview":"Chegam novos pedidos de socorro para os anjos da guarda: uma pessoa se acidenta numa trilha no meio da mata e um homem é agredido na cabeça.","air_date":"2015-11-10","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0},"16":{"name":"Episódio 16","overview":"Neste último episódio, acompanhe os anjos da guarda de Santa Catarina ajudando um rapaz que teve um acidente andando de skate, apagando um carro em chamas e dando os primeiros socorros e salvando um homem atropelado no canteiro de uma avenida de Florianópolis.","air_date":"2015-11-17","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/b5UKzJwxE07mCKq04pO8SSEvFvy.jpg","vote_average":0}}}}},
