"222922":{"id":"222922","name":"Jubileu","slug":"jubileu","original_title":"Jubilee","overview":"Em uma Índia recém-independente, um dono de estúdio, sua esposa estrela de cinema, um funcionário de confiança, uma dançarina e um refugiado terão seus caminhos cruzados em busca do estrelato e sucesso.","first_air_date":"2023-04-07","episode_run_time":0,"vote_average":7.1,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Vikramaditya Motwane","Soumik Sen"],"production_companies":["Andolan Films","Reliance Entertainment","Phantom Films"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/rnf5KcBUd9RJ7AswKySXLeM5PoK.jpg","poster_path":"https://image.tmdb.org/t/p/original/l1mIwrnnU80KGtaKDHgDFZs1DSU.jpg","cast":["Prosenjit Chatterjee","Aparshakti Khurana","Aditi Rao Hydari","Sidhant Gupta","Wamiqa Gabbi"],"trailer":"N/A","seasons":{"1":{"name":"Minissérie","poster_path":"https://image.tmdb.org/t/p/original/l1mIwrnnU80KGtaKDHgDFZs1DSU.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/l1mIwrnnU80KGtaKDHgDFZs1DSU.jpg","air_date":"2023-04-07","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Aag","overview":"O dono de estúdio, Srikant Roy, descobre que sua esposa Sumitra está tendo um caso com o novo astro do estúdio, Jamshed Khan. Roy envia seu leal assistente Binod a Lucknow para trazer os dois de volta com urgência. Binod encontra uma maneira inusitada de conseguir o que seu chefe deseja.","air_date":"2023-04-07","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/wEQO0qcC9QmBFM0tGu68o3CtbdS.jpg","vote_average":0},"2":{"name":"Sunghursh","overview":"Roy aposta em seu novo astro, Binod, que explora sua nova vida. Sumitra se recusa a deixar Jamshed. Jay chega a Bombaim e é forçado a seguir uma vida de crime. Niloufer se muda para Bombaim, mas fica em uma situação perigosa.","air_date":"2023-04-07","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/lojB9pexEXh96q1Pl0nN31Aysj3.jpg","vote_average":0},"3":{"name":"Dosti","overview":"Jay sai em busca de emprego e reencontra um velho amigo. Niloufer cria suas próprias oportunidades. Nanik Jotwani e Roy embarcam em uma aventura revolucionária. A aposta de distribuição de Roy em Sunghursh falha. O estrelato de Binod é ameaçado por uma reviravolta surpreendente.","air_date":"2023-04-07","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/4w37JxUXL7HACtHsE4BUwM010xD.jpg","vote_average":0},"4":{"name":"Barsaat Ki Raat","overview":"Binod é chantageado. Niloufer e Jay reacendem sua amizade. Jotwani apresenta Roy a alguns amigos novos e poderosos. Roy protege Binod de uma catástrofe, às custas da carreira de Jay.","air_date":"2023-04-07","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/gAaQ5tZn5hK9tw9hKWbwjqi8ypD.jpg","vote_average":0},"5":{"name":"Baazi","overview":"Uma intriga internacional começa na Roy Filmes. Jay está determinado a abrir seu próprio estúdio, mas precisa fazer um grande sacrifício pessoal para isso. Binod desiste de um compromisso e faz um inimigo no processo.","air_date":"2023-04-07","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/3or8z3Gjz8LS0ZQZkNMgAzsJqYH.jpg","vote_average":0},"6":{"name":"Taxi Driver","overview":"Binod é assombrado por memórias de Lucknow. Jay se esforça para filmar seu filme. Niloufer toma uma grande decisão. Sumitra finalmente encontra uma pista em sua busca por justiça.","air_date":"2023-04-14","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/ekLFsDhBaFzcMzSci9sz06fryZc.jpg","vote_average":0},"7":{"name":"Rajmahal","overview":"Niloufer conhece o homem dos seus sonhos. Jay, com o coração partido, decide seguir em frente. Binod e Niloufer começam a filmar Rajmahal. Jay e Binod se desentendem. Sumitra revela o segredo de Binod à imprensa.","air_date":"2023-04-14","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/oL5QJJwFbHHVshmFROTwEKZGzDH.jpg","vote_average":0},"8":{"name":"Kismet","overview":"Roy refilma Rajmahal para salvar o filme do escândalo. O fracasso de Rajmahal tem consequências surpreendentes para Jay. O desgosto de Niloufer a leva aos braços de outra pessoa. Roy faz uma oferta irrecusável a Jay, levando-o a destruir uma amizade.","air_date":"2023-04-14","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/xZLF1OXpDWeKswKAXB7PdoKI6Ym.jpg","vote_average":0},"9":{"name":"Bewafa","overview":"Sumitra encontra uma testemunha. Binod se prepara para a maior traição de sua vida. Jay põe em risco seu futuro. Roy dá um presente inesperado para Sumitra.","air_date":"2023-04-14","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/5bVX1YP3mXbfLXz8VuSkXdvtT8L.jpg","vote_average":0},"10":{"name":"Jubilee","overview":"Sumitra leva Binod ao tribunal. Binod convoca uma testemunha inesperada. Os planos de fuga de Jay são postos à prova. À medida que o drama da série é resolvido, os personagens encontram seus próprios caminhos para seguir em frente.","air_date":"2023-04-14","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/gUM1EASEaA3tWVTj4g0emx4NxkF.jpg","vote_average":0}}}}},
